usingDates = true

function event_scheduler(events)
    # Check if list is empty
    if isempty(events)
        return "No events"
    end

    # Iterate through events, comparing start and finish times
    for (i, (start, finish)) in enumerate(events), start=1)
        for j in i+1:length(events), start=start)
            if overlap(start, finish), events[j][1], events[j][2])
                return "Conflict"
        end
    end

    return "No conflicts"
end

# Helper function to check if two time intervals overlap
function overlap(start1, end1), start2, end2)
    return (start1 <= end2) && (start2 <= end1))
end
